    </div>
  )
}

Datasources.getInitialProps = async (req): Promise<Array<Datasource>> => {
  try {
    const Authorization = Cookies(req).id
    const Datasources = await DatasourceActions.getDatasources({ Authorization })
    return Datasources
  } catch (e) {
    return []
  }
}

export default Datasources
